  input: '"TEXT","F3A","C00391193","To conform with the FEC requirements of best efforts
    procedures the Brad Smith for Congress campaign does the following for fifty dollar
    and above donors.  First, on the original solicitation donors are told that we
    must collect information about them, their employer, and their occupation and
    are provided the appropriate space to give this information.  Second, if we do
    not receive this information we reply with a thank you letter and request for
    further information, including a form for the reply, self addressed stamped envelope,
    and also remind donors that we are required to obtain this information.  Finally,
    we follow up with phone calls from our campaign, as noted in our personal office
    records, as a final effort to obtain this information.  Also, a reimbursement
    disbursement for Brad Smith on November twenty first exceeds two hundred dollars,
    but does not meet the FEC requirements for a separate vendor listing as none of
    the vendors for that reimbursement in the aggregate exceed two hundred dollars
    individually."'
